	add("carabao", "{\"term\":\"carabao\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027carabao\u0027 from a w:Visayan languages|Visayan language.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A domesticated subspecies of water-buffalo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Greg Nickles, \u0027Philippines: The Culture\u0027, [http://books.google.com.au/books?id\u003dsRP_AShe2cEC\u0026amp;pg\u003dPA30\u0026amp;dq\u003d%22carabao%22%7C%22carabaos%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d-C0PUq_TFIjuiAexy4CgDw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carabao%22%7C%22carabaos%22\u0026amp;f\u003dfalse page 30\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Filipinos tell several stories about the \u0027\u0027carabao\u0027\u0027. The Tagalog, who live mainly on Luzon, tell the following story about how the \u0027\u0027carabao\u0027\u0027, one of the largest animals in the country, is tricked by one of the smallest animals, a hummingbird\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Cindy Fazzi, \u0027How to Draw the Philippines\u0027s Sights and Symbols\u0027, [http://books.google.com.au/books?id\u003dET5YWTm1VPkC\u0026amp;pg\u003dPA24\u0026amp;dq\u003d%22carabao%22%7C%22carabaos%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d-C0PUq_TFIjuiAexy4CgDw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carabao%22%7C%22carabaos%22\u0026amp;f\u003dfalse page 24\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Malay people who arrived in the Philippines between 1500 B.C. and 500 B.C. introduced the \u0027\u0027carabao\u0027\u0027 as a work animal. Today the \u0027\u0027carabao\u0027\u0027, also known as the water buffalo, is a very important animal in the Philippines. \u0027\u0027Carabaos\u0027\u0027 are popular farm animals\", \"priority\":7}]}, \"synonyms\":{}}");

