	add("caracole", "{\"term\":\"caracole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|caracole|lit\u003dsnail\u0027s shell|pos\u003dnoun|lang\u003den}}, {{m|fr|caracoler|pos\u003dverb}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A half-turn performed by a horse and rider in dressage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1820-1872\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With curvet and with \u0027\u0027caracole\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A combat maneuver\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A spiral staircase\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carafe", "{\"term\":\"carafe\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"French\", \"Italian\"], \"text\":\"First attested w:1786|1786, from French \u0027carafe\u0027 from Italian \u0027caraffa\u0027 probably from Arabic \u0027غُرْفَة\u0027 (cup or dipper) from \u0027غَرَفَ\u0027 (to ladle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bottle, usually glass and with a flared lip, used for serving water, wine, or other beverages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A glass pot with a spout for pouring, used for both serving coffee and as a receptacle during the brewing process\", \"priority\":2}]}, \"synonyms\":{}}");

