	add("carapace", "{\"term\":\"carapace\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Portuguese\"], \"text\":\"From French \u0027carapace\u0027 (tortoise shell) from Portuguese \u0027carapaça\u0027 (carapace, shell) of uncertain origin.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; Compare Catalan carabassa.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hard protective covering of bone or chitin, especially one which covers the dorsal portion of an animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 January 8, Simon Jenkins, “The proliferation of nuclear panic is politics at its most ghoulish” in \u0027The Guardian\u0027, §: “Comment \u0026amp; Debate”, page 29, column\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This is all a massive failure of science to pierce the \u0027\u0027carapace\u0027\u0027 of public ignorance\", \"priority\":3}]}, \"synonyms\":{}}");

	add("caravan", "{\"term\":\"caravan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"pahlavi\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027caravane\u0027 from Old french (842-ca. 1400) \u0027carvane\u0027 from Persian \u0027کاروان\u0027 from Pahlavi \u0027kʾlwʾn\u0027\u0027 The word was used to designate a group of people who were travelling by camel or horse on the Silk Road.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A convoy or procession of travelers, their vehicles and cargo, and any pack animals, especially camels crossing a desert\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1846\u0027\u0027, w:Rufus B. Rufus B. Sage, \u0027s:Rocky Mountain Rocky Mountain Life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To the left the \u0027\u0027caravan\u0027\u0027 animals, securely picketed, at regular distances of some fifteen yards apart, occupied an area of several acres\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, w:Rudyard Rudyard Kipling, \u0027s:The Man Who Would Be The Man Who Would Be King\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Would they could have foretold that my \u0027\u0027caravan\u0027\u0027 would have been cut up by the Shinwaris almost within shadow of the Pass!” grunted the Eusufzai agent of a Rajputana trading-house whose goods had been feloniously diverted into the hands of other robbers just across the Border, and whose misfortunes were the laughing-stock of the bazar. “Ohé, priest, whence come you and whither do you go\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, s:Author:W. B. W. B. Kimberly (editor), \u0027s:History of West Australia/Chapter History of West Australia\u0027, Chapter 21\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Camel \u0027\u0027caravans\u0027\u0027, and courageous teamsters opened regular carrying businesses between Southern Cross and Coolgardie, while coaches began to run over the desert\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A furnished vehicle towed behind a car, etc., and used as a dwelling when stationary\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Roger Cross, Avon Hudson, \u0027Beyond Belief: The British Bomb Tests: Australia\u0027s Veterans Speak Out\u0027, %22caravans%22+-intitle:%22caravan|caravans%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgpIeT__rKcujiAep0Z3fDQ\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"%22caravans%22%20-intitle%3A%22caravan|caravans%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 92\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027caravans\u0027\u0027 were the demarcation between the non-radioactive areas and the radioactive areas. There were two main \u0027\u0027caravans\u0027\u0027, one for people going into the forward area, and the other \u0027\u0027caravan\u0027\u0027 was for people returning\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Chris Cleave, \u0027Incendiary\u0027, %22caravans%22+-intitle:%22caravan|caravans%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dx5QeT-u0F6e6iQet6KnqDQ\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22caravans%22%20-intitle%3A%22caravan|caravans%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The best thing about \u0027\u0027caravans\u0027\u0027 is that they\u0027re always exactly the same, said Terence Butcher. You can tow your \u0027\u0027caravan\u0027\u0027 to Brighton or Bournemouth or Bognor. Doesn′t make the blindest bit of difference. When you close the door behind you at the end of the day you′re home\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Jo Nesbo, \u0027Nemesis\u0027, %22caravans%22+-intitle:%22caravan|caravans%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dx5QeT-u0F6e6iQet6KnqDQ\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22caravans%22%20-intitle%3A%22caravan|caravans%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 357\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"At the end of the car park were three \u0027\u0027caravans\", \"priority\":17}]}, \"synonyms\":{}}");

