	add("carbohydrate", "{\"term\":\"carbohydrate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From their general formula C\u0026lt;sub\u0026gt;n\u0026lt;/sub\u0026gt;(H\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;O)\u0026lt;sub\u0026gt;n\u0026lt;/sub\u0026gt;; they were once thought to be hydrates of carbon.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sugar, starch, or cellulose that is a food source of energy for an animal or plant; a saccharide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/in-the-news-47 In the passage\u003dOxygen levels on Earth skyrocketed 2.4 billion years ago, when cyanobacteria evolved photosynthesis: the ability to convert water and carbon dioxide into \u0027\u0027carbohydrates\u0027\u0027 and waste oxygen using solar energy\", \"priority\":2}]}, \"synonyms\":{}}");

