	add("carbon", "{\"term\":\"carbon\", \"etymology\":{\"influencers\":[{},{},{},{},{},{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027carbone\u0027 coined by {{w|Lavoisier}}, from Latin {{m|la|carbō||charcoal, coal}}, from Proto-indo-european {{m|ine-pro|*ker-||to burn}}, see also Old English \u0027heorþ\u0027 (hearth) Old Norse \u0027hyrr\u0027 (fire) Gothic \u0027𐌷𐌰𐌿𐍂𐌹\u0027 (coal) Old High German \u0027harsta\u0027 (roasting) Russian \u0027церен\u0027 (brazier) Old Church Slavonic \u0027крада\u0027 (hearth, fireplace) Lithuanian \u0027kuriu\u0027 (to heat) \u0027karstas\u0027 (hot) and \u0027krosnis\u0027 (oven) Sanskrit \u0027कृष्ण\u0027 (burnt, black) and \u0027कूडयति\u0027 (singes) Latin \u0027cremare\u0027 (to burn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chemical element (\u0027symbol\u0027 C) with an atomic number of 6\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An atom of this element, in reference to a molecule containing it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A methane molecule is made up of a single \u0027\u0027carbon\u0027\u0027 with four hydrogens\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A sheet of carbon paper\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, \u0027\u0027, Penguin 2011, page 51\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He stepped back and opened his bag and took out a printed pad of D.O.A. forms and began to write over a \u0027\u0027carbon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A carbon copy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A fossil fuel that is made of impure carbon such as coal or charcoal\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"carbon Carbon dioxide, in the context of global warming and climate change\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/environment/2014/apr/16/canada-becoming-launch-pad-of-a-global-tar-sands-and-oil-shale-frenzy Canada becoming launch-pad of a global tar sands and oil shale passage\u003dIf Alberta’s reserves are a \u0027\u0027carbon\u0027\u0027 bomb, this global expansion of tar sands and oil shale exploitation amounts to an escalating emissions arms race, the unlocking of a subterranean cache of weapons of mass ecological destruction\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A carbon rod or pencil used in an arc lamp\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A plate or piece of carbon used as one of the elements of a voltaic battery\", \"priority\":12}]}, \"synonyms\":{}}");

