	add("carborundum", "{\"term\":\"carborundum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|carbon|corundum|lang\u003den}}; originally a trade name.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Crystals of silicon carbide used as an abrasive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1892\u0027\u0027, Nikola Tesla, \u0027Experiments with Alternate Currents of High Potential and High Frequency\u0027, Wildside Press LLC (ISBN 9780809501632), page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is no doubt that such a button — properly prepared under great pressure — of \u0027\u0027carborundum\u0027\u0027, especially of powder of the best quality, will withstand the effect of the bombardment fully as well as anything we know\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, M.R. Walter, \u0027Stromatolites\u0027, Elsevier (ISBN 9780080869322), page 2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This can most readily be done by use of \u0027\u0027carborundum\u0027\u0027 marking. The procedure involves successive marking of the same mat with layers of \u0027\u0027carborundum\u0027\u0027 at least twice\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Reg F. Chapman, Gerrit de Boer, \u0027Regulatory Mechanisms in Insect Feeding\u0027, Springer Science \u0026amp; Business Media (ISBN 9780412031410), page 2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"At the same times, samples were taken to determine that the carborundum treatment did increase the amount of wear of the mandibles compared with insects on the diet without \u0027\u0027carborundum\u0027\u0027 powder\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Gerald W. R. Ward, \u0027The Grove Encyclopedia of Materials and Techniques in Art\u0027, Oxford University Press (ISBN 9780195313918), page 8\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Print made by combining \u0027\u0027carborundum\u0027\u0027—a carbon and silicon compound customarily used for polishing by abrasion—with synthetic resin or varnish (see also Prints, §III, 5\", \"priority\":9}]}, \"synonyms\":{}}");

