	add("carbuncle", "{\"term\":\"carbuncle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027carbuncle\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deep-red or fiery colored garnet or other dark red precious stone, especially when cut cabochon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1602\u0027\u0027. Hamlet\u0027 by w:William William Shakespeare, act 2 scene 2 line 401\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"With eyes like \u0027\u0027carbuncles\u0027\u0027, the hellish Pyrrhus\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027. \u0027Old Testament\u0027, King James Version, Isaiah 54:12\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And I will make thy windows of agates, and thy gates of \u0027\u0027carbuncles\u0027\u0027, and all thy borders of pleasant stones\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An abscess larger than a boil, usually with one or more openings draining pus onto the skin. It is usually caused by bacterial infection\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A charge or bearing supposed to represent the precious stone, with eight sceptres or staves radiating from a common centre; an escarbuncle\", \"priority\":7}]}, \"synonyms\":{}}");

	add("carcass", "{\"term\":\"carcass\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"Dated from the late 13th Century {{C.E.}}; from Anglo-norman \u0027carcois\u0027 possibly related to Old french (842-ca. 1400) \u0027charcois\u0027 Cognate with French \u0027carcasse\u0027 \u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The body of a dead animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Johannes Weigelt, \u0027Recent Vertebrate \u0027\u0027Carcasses\u0027\u0027 and Their Paleobiological Implications\u0027, [https://books.google.com.au/books?id\u003dLJRvymSBFmoC\u0026amp;pg\u003dPA152\u0026amp;dq\u003d%22carcass%22%7C%22carcasses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAqJQVbDbPMLXmAXiuYCoDw\u0026amp;ved\u003d0CCYQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carcass%22%7C%22carcasses%22\u0026amp;f\u003dfalse page 152\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Plate 31, figure B shows a desiccated \u0027\u0027carcass\u0027\u0027 in the ventral position with a sharp S curvature in the vertebral column. Such pronounced drying-out of a \u0027\u0027carcass\u0027\u0027 probably happens only when it is quickly carried to a dry place and exposed to the strong rays of the sun\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Dorothy L. Cheney, Robert M. Seyfarth, \u0027How Monkeys See the World: Inside the Mind of Another Species\u0027, [https://books.google.com.au/books?id\u003dQbWTd85eHUgC\u0026amp;pg\u003dPA284\u0026amp;dq\u003d%22carcass%22%7C%22carcasses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAqJQVbDbPMLXmAXiuYCoDw\u0026amp;ved\u003d0COgCEOgBME\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carcass%22%7C%22carcasses%22\u0026amp;f\u003dfalse page 284\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Despite all of the groups\u0027 experiences with leopards and \u0027\u0027carcasses\u0027\u0027 in trees, neither the vervets nor the baboons gave alarm calls at the sight of the \u0027\u0027carcass\u0027\u0027 alone\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Maria S. Johnson, Tim R. Nagy, \u0027Chapter 10: Animal Body Composition Methods\u0027, Steven B. Heymsfield, Timothy G. Lohman, ZiMian Wang, Scott B. Going, (editors), \u0027Human Body Composition\u0027, 2nd Edition, [https://books.google.com.au/books?id\u003d_WoPgY4KAxgC\u0026amp;pg\u003dPA141\u0026amp;dq\u003d%22carcass%22%7C%22carcasses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAqJQVbDbPMLXmAXiuYCoDw\u0026amp;ved\u003d0CJ0CEOgBMD\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carcass%22%7C%22carcasses%22\u0026amp;f\u003dfalse page 141\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Instead, the majority of studies involve freezing the \u0027\u0027carcasses\u0027\u0027 until time permits the analysis\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The body of a slaughtered animal, stripped of unwanted viscera, etc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, D. M. Doty, John C. Pierce, \u0027Beef Muscle Characteristics as Related to Carcass Grade, Carcass Weight, and Degree of Aging\u0027, US Department of Agriculture, Technical Bulletin No. 1231, [https://books.google.com.au/books?id\u003d5LoXAAAAYAAJ\u0026amp;pg\u003dPA33\u0026amp;dq\u003d%22carcass%22%7C%22carcasses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAqJQVbDbPMLXmAXiuYCoDw\u0026amp;ved\u003d0CE4Q6AEwC\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carcass%22%7C%22carcasses%22\u0026amp;f\u003dfalse page 33\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Lean flavor scores for this muscle were lower than those for ribeye, especially in Prime grade \u0027\u0027carcasses\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, P. D. Warriss, \u0027Meat Science: An Introductory Text\u0027, [https://books.google.com.au/books?id\u003dmHvuFcKPGikC\u0026amp;pg\u003dPA20\u0026amp;dq\u003d%22carcass%22%7C%22carcasses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAqJQVbDbPMLXmAXiuYCoDw\u0026amp;ved\u003d0CI4CEOgBMD\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carcass%22%7C%22carcasses%22\u0026amp;f\u003dfalse page 20\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The most important is the \u0027\u0027carcass\u0027\u0027 but the liver, kidneys and, to a limited extent, various other visceral components also have value as food items.For example, the \u0027\u0027carcasses\u0027\u0027 from sheep and cattle have the head removed immediately after slaughter but in pigs this may be delayed until after chilling and further butchery\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Geoffrey C. Mead, \u0027Fresh and Further-Processed Poultry\u0027, Barbara Lund, Tony C. Baird-Parker (editors), \u0027Microbiological Safety and Quality of Food\u0027, [https://books.google.com.au/books?id\u003dlks9dALNzZAC\u0026amp;pg\u003dPA464\u0026amp;dq\u003d%22carcass%22%7C%22carcasses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAqJQVbDbPMLXmAXiuYCoDw\u0026amp;ved\u003d0CKMCEOgBMD\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22carcass%22%7C%22carcasses%22\u0026amp;f\u003dfalse page 464\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"In some countries, there is still a significant trade in chicken \u0027\u0027carcasses\u0027\u0027 that have been plucked, but not eviscerated, by the producer. Subsequently, the \u0027\u0027carcass\u0027\u0027 may be eviscerated by a butcher or in the kitchen of the consumer\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The body of a dead human, a corpse\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The framework of a structure, especially one not normally seen\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"An early incendiary ship-to-ship projectile consisting of an iron shell filled with saltpetre, sulphur, resin, turpentine, antimony and tallow with vents for flame\", \"priority\":23}]}, \"synonyms\":{}}");

