	add("cardecu", "{\"term\":\"cardecu\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027quar. French|quart d\u0027éc. French|écu\u0027 ‘quarter of an écu’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A silver French coin worth a quarter of an écu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Walter Scott, \u0027Ivanhoe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A set of hilding fellows there were, whom we dismissed to find them a new master — enough had been done for revenge and profit; the bunch of them were not worth a \u0027\u0027cardecu\", \"priority\":3}]}, \"synonyms\":{}}");

