	add("cardia", "{\"term\":\"cardia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027καρδία\u0027 (heart)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The section of the esophagus that connects to the stomach\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The heart\", \"priority\":2}]}, \"synonyms\":{}}");

