	add("cardialgy", "{\"term\":\"cardialgy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027\u0027 from Ancient greek (to 1453) \u0027καρδία\u0027 (heart) + \u0027ἄλγος\u0027 (pain, suffering)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Heartburn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1825\u0027\u0027 Connop Thirlwall, \u0027The Pictures\u0027 (translated from Ludwig Tieck\u0027s German\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These oysters, taken in excess, lead to sickness; this Burgundy, after a few stages, to red noses; these truffles, with the appurtenances, to dropsy, \u0027\u0027cardialgy\u0027\u0027 \u0027[Magenkrampf]\u0027 and similar complaints\", \"priority\":3}]}, \"synonyms\":{}}");

