	add("cardigan", "{\"term\":\"cardigan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after British military commander w:James Thomas Brudenell, 7th Earl of Cardigan|James Thomas Brudenell, 7th Earl of Cardigan\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of sweater or jumper that fastens up the front with buttons or a zipper, usually machine- or hand-knitted from wool\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cardinality", "{\"term\":\"cardinality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cardinal|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Of a set, the number of elements it contains\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The empty set has a \u0027\u0027cardinality\u0027\u0027 of zero\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The property of a relationship between a database table and another one, specifying whether it is one-to-one, one-to-many, many-to-one, or many-to-many\", \"priority\":3}]}, \"synonyms\":{}}");

