	add("cardsharp", "{\"term\":\"cardsharp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|card|sharp|lang\u003den}}{{etystub|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is skilled at card games, especially at cheating in them\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of Tim\u0027s great-grandparents had been a \u0027\u0027cardsharp\u0027\u0027 in the wild west, and had been shot dead during a game\", \"priority\":2}]}, \"synonyms\":{}}");

	add("carer", "{\"term\":\"carer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"someone who looks after another, either as a job or often through family responsibilities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Have you thought of a job as a \u0027\u0027carer\u0027\u0027 for disabled people\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He retired early to be a full-time \u0027\u0027carer\u0027\u0027 for his wife / husband\", \"priority\":3}]}, \"synonyms\":{}}");

