	add("career", "{\"term\":\"career\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\", \"Italian\", \"Latin\", \"old provençal (to 1500)\"], \"text\":\"Mid 16th century, from French \u0027carrière\u0027 (a road or racecourse), from Italian \u0027carriera\u0027, from Old provençal (to 1500) \u0027carreira\u0027, from {{m|la|carrāria}} based on Latin \u0027carrus\u0027 \u0027wheeled vehicle\u0027. Or from Middle french (ca. 1400-1600) \u0027carriere\u0027, from Old Provençal/Occitan \u0027carriera\u0027 (\u0026quot;road\u0026quot;), from {{m|la|carrāria}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One\u0027s calling in life; a person\u0027s occupation; one\u0027s profession\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"General course of action or conduct in life, or in a particular part of it\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Washington\u0027s \u0027\u0027career\u0027\u0027 as a soldier\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Wilkin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"when a horse is running in his full \u0027\u0027career\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027, Thomas Carlyle, \u0027:w:Past and Present Past and Present\u0027, book 3, chapter XIII, \u0027Democracy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It may be admitted that Democracy, in all meanings of the word, is in full \u0027\u0027career\u0027\u0027; irresistible by any Ritter Kauderwalsch or other Son of Adam, as times go\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A jouster\u0027s path during a joust\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027: w:Sir Walter Sir Walter Scott, Ivanhoe\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"These knights, therefore, their aim being thus eluded, rushed from opposite sides betwixt the object of their attack and the Templar, almost running their horses against each other ere they could stop their \u0027\u0027career\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A short gallop of a horse\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1603\u0027\u0027, John Florio, trans. Michel de Montaigne, \u0027Essyas\u0027, I.48\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"It is said of \u0027Cæsar\u0027 that in his youth being mounted upon a horse, and without any bridle, he made him run a full \u0027\u0027cariere\u0027\u0027 [tr. ], make a sodaine stop, and with his hands behind his backe performe what ever can be expected of an excellent ready horse\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The flight of a hawk\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A racecourse; the ground run over\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"to go back again the same \u0027\u0027career\", \"priority\":17}]}, \"synonyms\":{}}");

	add("careerist", "{\"term\":\"careerist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|career|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who pursues the advancement of his career at the expense of other values\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Alfred Kern, “Waiting for Euripides”, reprinted in Malham M. Wakin (editor), \u0027Military Ethics\u0027, DIANE Publishing (1994), ISBN 9780788113116, [http://books.google.com/books?id\u003dB9EvXhH1ZVAC\u0026amp;pg\u003dPA121\u0026amp;dq\u003dcareerist page 121\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027careerist\u0027\u0027 is a square-filler, a time-server. His talents and imagination have been circumscribed to perform managerial duties\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Anita Blair, quoted in \u0027U.S. Society \u0026amp; Values\u0027, June 1997: \u0027The Changing Roles of Women in the United States\u0027, DIANE Publishing, ISBN 9781428967496, [http://books.google.com/books?id\u003dJZAsHQvlWX8C\u0026amp;pg\u003dPT26\u0026amp;dq\u003dcareerist page 27\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You’ve got a lot of elite \u0027\u0027careerist\u0027\u0027 women in the officer corps who have a certain set of desires usually related to their career\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carefreeness", "{\"term\":\"carefreeness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|carefree|ness|t2\u003dthe property of|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being lighthearted, joyous, cheerful, without a care\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carefulness", "{\"term\":\"carefulness\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) \u0027carfulnes\u0027 (care, anxiety, a charge, cure of souls, solicitude, carefulness, curiousness, curiosity) equivalent to {{suffix|careful|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being careful\", \"priority\":1}]}, \"synonyms\":{}}");

