	add("carelessness", "{\"term\":\"carelessness\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) *\u0027\u0027 (carelesnes, *carlesnesse) from Old english (ca. 450-1100) {{m|ang|carlēasnes||freedom from care, security, carelessness}}, equivalent to {{suffix|careless|ness|lang\u003den|nocat\u003d1}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lack of care\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This accident was caused by \u0027\u0027carelessness\", \"priority\":2}]}, \"synonyms\":{}}");

	add("carenum", "{\"term\":\"carenum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reduction of must in Ancient Roman cuisine, made by boiling down grape juice or must in large kettles until reduced to two thirds of the original volume\", \"priority\":1}]}, \"synonyms\":{}}");

	add("caress", "{\"term\":\"caress\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\", \"Sanskrit\"], \"text\":\"From French \u0027caresse\u0027 from Italian \u0027carezza\u0027 (dear) from Latin {{m|la|cārus||dear}}, from Proto-indo-european {{m|ine-pro|*kāro-}} (English \u0027whore\u0027 , akin to Sanskrit \u0027काम\u0027 (love)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of endearment; any act or expression of affection; an embracing, or touching, with tenderness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Longfello\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Wooed her with his soft \u0027\u0027caresses\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He exerted himself to win by indulgence and \u0027\u0027caresses\u0027\u0027 the hearts of all who were under his command\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A gentle stroking or rubbing\", \"priority\":6}]}, \"synonyms\":{}}");

	add("caresser", "{\"term\":\"caresser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|caress|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who caresses\", \"priority\":1}]}, \"synonyms\":{}}");

