	add("cargo", "{\"term\":\"cargo\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027cargo\u0027 (load, burden) from \u0027cargar\u0027 (to load) from \u0027carricare\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Freight carried by a ship, aircraft etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1806\u0027\u0027, James Harrison, \u0027The Life of the Right Honourable Horatio Lord Viscount Nelson\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;…her whole and entire \u0027\u0027cargo\u0027\u0027; and, also, all such other \u0027\u0027cargoes\u0027\u0027 and property as may have been landed in the island of Teneriffe,…\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027, Nephi Anderson, \u0027Story of Chester Lawrence\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;…but human life is worth more than ships or \u0027\u0027cargos\u0027\u0027.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Papua New Guinea\u0027) Western material goods\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Martha Kaplan, \u0027Neither Cargo Nor Cult: Ritual Politics and the Colonial Imagination in Fiji\u0027, Duke University Press, page x\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;They wrote of Pacific people with millenarian (and sometimes anti-colonial) expectations who used magical means to get western things (hence the term \u0026quot;\u0027\u0027cargo\u0027\u0027\u0026quot; cult).\u0026quot\", \"priority\":8}]}, \"synonyms\":{}}");

	add("carhouse", "{\"term\":\"carhouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|car|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A garage attached to a hous\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, w:Harper Harper Lee, \u0027w:To Kill a To Kill a Mockingbird\u0027, chapter 15\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As far back as I could remember, there was always a Chevrolet in excellent condition in the \u0027\u0027carhouse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Id., chapter 16\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Atticus killed the engine in the driveway and coasted to the \u0027\u0027carhouse\u0027\u0027; we went in the back door and to our rooms without a word\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A storage area for streetcars\", \"priority\":6}]}, \"synonyms\":{}}");

	add("caricature", "{\"term\":\"caricature\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027lang\u003dfr\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pictorial representation of someone in which distinguishing features are exaggerated for comic effect\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A grotesque misrepresentation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A grotesque \u0027\u0027caricature\u0027\u0027 of virtue\", \"priority\":4}]}, \"synonyms\":{}}");

	add("caricaturist", "{\"term\":\"caricaturist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|caricature|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who draws caricatures\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1828\u0027\u0027 Amelia Alderson Opie - Detraction Displaye\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But, the power of the \u0027\u0027caricaturist\u0027\u0027 lies in exhibiting with increased ugliness personal and natural defects\", \"priority\":3}]}, \"synonyms\":{}}");

