	add("carillon", "{\"term\":\"carillon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|carillon|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of bells, often in a bell tower, sometimes operated by means of a keyboard (manual or pedal), originating from the Low Countries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A tune adapted to be played by musical bells\", \"priority\":2}]}, \"synonyms\":{}}");

	add("carina", "{\"term\":\"carina\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027carina|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A longitudinal ridge or projection like the keel of a boat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Part of a papilionaceous flower consisting of two petals, commonly united, which encloses the organs of fructification\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The keel of the breastbone of birds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of several features that have a projecting central ridge\", \"priority\":4}]}, \"synonyms\":{}}");

	add("carindacillin", "{\"term\":\"carindacillin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A penicillin antibiotic, a prodrug of carbenicillin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carinthia", "{\"term\":\"carinthia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A federal state of modern Austria\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A region of modern Slovenia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A region of the Holy Roman Holy Roman and Austrian empires\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1759\u0027\u0027, George Sale et al., \u0027The Modern Part of an Universal History\u0027, : \u0027History of the German Empire\u0027, [http://books.google.com/books?id\u003ddFtjAAAAMAAJ\u0026amp;pg\u003dPA2 page\u0026amp;nbsp;2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Since the reign of \u0027Charlemagne\u0027, this country is divided into \u0027High High\u0027 and \u0027Low Germany\u0027: the firſt, towards the ſouth, comprehending the \u0027Palatinate\u0027 of the \u0027Rhine\u0027, \u0027Franconia\u0027, \u0027Suabia\u0027, \u0027Bavaria\u0027, \u0027Bohemia\u0027, \u0027Moravia\u0027, Auſtria\u0027, \u0027\u0027\u0027Carinthia\u0027\u0027\u0027, \u0027Carniola\u0027, \u0027Stiria\u0027, \u0027Tyrol\u0027, the Swiſs\u0027, and the Griſons\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cariogenesis", "{\"term\":\"cariogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The formation of dental caries\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carisoprodol", "{\"term\":\"carisoprodol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A particular skeletal muscle relaxant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carla", "{\"term\":\"carla\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"borrowed from Italian or German\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carlo", "{\"term\":\"carlo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of Italian origin. English equivalents: Charles, Car\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1867\u0027\u0027 w:Frances Frances Eleanor Trollope, \u0027Mabel\u0027s Progress\u0027, All the Year Round, June 15, 1867, page 579\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Charles, come here and be presented to your cousin, Mabel Earnshaw. His name is \u0027\u0027Carlo\u0027\u0027, but I couldn\u0027t possibly call him by it; it sounds like a dog. At least, pronounced in my English fashion. And I \u0027can\u0027t\u0027 roll my r\u0027s\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carly", "{\"term\":\"carly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A feminine form of \u0027\u0027 taken to use in the latter half of the 20th century, also a pet form of \u0027\u0027 \u0027\u0027 and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 Sheila Weller, \u0027Girls Like Us: Carole King, Joni Mitchell, Carly Simon-- And the Journey of a Generation\u0027, Simon and Schuster, ISBN 1416564772, page 263\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She introduced herself. I said, \u0027Where\u0027d you get a name like \u0027\u0027Carly\u0027\u0027?\u0027 and she said, from her aunt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("carlin", "{\"term\":\"carlin\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse \u0027karling\u0027 feminine of \u0027karl\u0027 (carl)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An old woman\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carlism", "{\"term\":\"carlism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Carlos|ismo|gloss1\u003dInfante Carlos, Count of Molina|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political movement in Spain that seeks the establishment of a separate line of the Bourbon family on the Spanish throne\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carmaker", "{\"term\":\"carmaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|car|maker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A company that manufactures automobiles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Thomas H. Klier, James M. Rubenstein, \u0027Who Really Made Your Car?\u0027 (page 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Helper and Sako (1995) did detect some convergence in the way U.S. and Japanese \u0027\u0027carmakers\u0027\u0027 work with suppliers\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carmaking", "{\"term\":\"carmaking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|car|making|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The manufacture of automobile\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carmot", "{\"term\":\"carmot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mythical element of which the philosopher\u0027s stone was believed to be composed\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carmustine", "{\"term\":\"carmustine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A compound related to mustard gas, used as an alkylating agent in chemotherapy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carnage", "{\"term\":\"carnage\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027carnage\u0027 from Latin \u0027carnaticum\u0027 (slaughter of animals) itself from Latin \u0027carnem\u0027 accusative of \u0027caro\u0027 (flesh)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Death and destruction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"What remains after a massacre, e.g. the corpses or gore\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any chaotic situation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Simon Spence, \u0027Happy Mondays: Excess All Areas\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The lads had recently returned from a wild summer on the party island of Ibiza, an increasingly popular hotspot for working-class British youth. But this was not a scene of drunken holiday \u0027\u0027carnage\u0027\u0027 in tacky discos\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carnapping", "{\"term\":\"carnapping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|car|kidnapping|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Theft of a motor vehicle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carnation", "{\"term\":\"carnation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027carnation\u0027 (person\u0027s color or complexion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of Eurasian plant widely cultivated for its flowers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"originally, \u0027Dianthus caryophyllus\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"other members of genus \u0027Dianthus\u0027 and hybrid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The type of flower they bear, originally flesh-coloured, but since hybridizing found in a variety of colours\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A rosy pink colou\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The pinkish colors used in art to render human face and fles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sometimes, a scarlet colour\", \"priority\":7}]}, \"synonyms\":{}}");

	add("carnet", "{\"term\":\"carnet\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\"], \"text\":\"From French \u0027carnet\u0027 (notebook) from Middle french (ca. 1400-1600) \u0027quernet\u0027 (group of four sheets)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A customs document that allows the temporary duty-free importation of a particular articl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A collection of travel tickets in the form of a booklet that is sold at a discount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If you think you\u0027re going to use more than ten single trip tickets within Zone 1 in a twelve month period, you can buy a \u0027\u0027carnet\u0027\u0027 of ten tickets for £17 - your cost per journey reduces from £2 down to £1.70\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carnism", "{\"term\":\"carnism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the same root as {{m|en|carnal}}, {{suffix||ism|lang\u003den}}. Coined by American sociologist {{w|Melanie Joy}} as an antonym of {{m|en|vegetarianism}}.\u0026lt;ref\u0026gt;Margo DeMello, \u0027Animals and Society: An Introduction to Human-Animal Studies\u0027 (2012, ISBN 0231526768)\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of eating (certain) animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Will Anderson, \u0027This Is Hope: Green Vegans and the New Human Ecology\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Now we need a universal consensus about standards of decency toward ecosystems, individuals from other species, and Earth. We cannot do this unless we end \u0027\u0027carnism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Julieanna Hever, \u0027The Vegiterranean Diet: The New and Improved Mediterranean Diet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"So violent systems such as \u0027\u0027carnism\u0027\u0027 need to use a set of psychological and social defense mechanisms so that humane people participate in inhumane practices without fully realizing what they are doing. The primary defense of \u0027\u0027carnism\u0027\u0027 is\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carnivory", "{\"term\":\"carnivory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|carnivore|y|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The eating of meat; carnivorousness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027The Better Angels of Our Nature\u0027 (Penguin 2012), page 571\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But if the natural \u0027\u0027carnivory\u0027\u0027 of other species counts for something, why not the natural \u0027\u0027carnivory\u0027\u0027 of \u0027Homo sapiens\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carnography", "{\"term\":\"carnography\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027carnis\u0027 (meat) and Ancient Greek \u0027γραφή\u0027 (writing) lt;!-- graphē? or rather graphia? --\u0026gt;, by analogy to \u0027pornography\u0027 Although it is often taken to be a blend \u0027carnage\u0027 and \u0027pornography\u0027 this is not the case.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any writing, films, images, or other material that contains gratuitous amounts of bloodshed or violence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Linda Badley, \u0027Film, horror, and the body fantastic\u0027 (page 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In 1986, Philip Brophy noted in Screen magazine that the horror film defied critics\u0027 attempts to deal with it as other than plotless \u0027\u0027carnography\u0027\u0027, gore, and effects for an increasingly brutalized mass audience\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carnosine", "{\"term\":\"carnosine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A dipeptide of the amino acids beta-alanine and histidine, highly concentrated in muscle and brain tissues\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carnotite", "{\"term\":\"carnotite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Carnot|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A yellow mineral that is a potassium uranyl vanadate that is a major ore or uranium, with the chemical formula K\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;(uranium|Uoxygen|O\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;)\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;(vanadium|VO\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;)\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;\u0027\u0027·\u0027\u00273water|H\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;O\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carol", "{\"term\":\"carol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027carole\u0027 from Old italian \u0027carola\u0027 from \u0027choraula\u0027 from Ancient greek (to 1453) \u0027χοραυλής\u0027 (one who accompanies a chorus on the flute) from \u0027χορός\u0027 (dance, choir) + \u0027αὐλός\u0027 (flute) Compare \u0027chorus\u0027 \u0027terpsichorean\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A round dance accompanied by singing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A song of joy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the costly feast, the \u0027\u0027carol\u0027\u0027, and the danc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027, w:Kenneth Kenneth Grahame, \u0027w:The Wind in the The Wind in the Willows\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The sunshine struck hot on his fur, soft breezes caressed his heated brow, and after the seclusion of the cellarage he had lived in so long the \u0027\u0027carol\u0027\u0027 of happy birds fell on his dulled hearing almost like a shout\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A religious song or ballad of joy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"They sang a Christmas \u0027\u0027carol\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In the darkness sing your \u0027\u0027carol\u0027\u0027 of high praise\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Longfello\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I heard the bells on Christmas Day / Their old, familiar \u0027\u0027carol\u0027\u0027 play\", \"priority\":11}]}, \"synonyms\":{}}");

	add("carom", "{\"term\":\"carom\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Probably corrupted from French \u0027carambole\u0027 (the red ball in billiards).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shot in which the ball struck with the cue comes in contact with two or more balls on the table; a hitting of two or more balls with the player\u0027s ball\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A billiard-like Indian game in which players take turns flicking checker-like pieces into one of four goals on the corners of (one meter by one meter square) board\", \"priority\":2}]}, \"synonyms\":{}}");

	add("carolina", "{\"term\":\"carolina\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Latinate form of Caroline; rare in English\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Either North Carolina or South Carolina\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I drove all the way from Florida to \u0027\u0027Carolina\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A town in Alabama\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A municipality in Maranhão, Brazil\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A municipality in Puerto Rico\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A town in Mpumalanga, South Africa\", \"priority\":7}]}, \"synonyms\":{}}");

	add("carotenol", "{\"term\":\"carotenol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|carotene|ol|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A yellow pigment; an alcohol of carotene\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1945\u0027\u0027, Eugene Rabinowitch, \u0027Photosynthesis and Related Processes\u0027, volume 1, page 47\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"almost a dozen other \u0027\u0027carotenols\u0027\u0027 are regularly found in green leaves\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Shubhrata R. Mishra, \u0027Photosynthesis in Plants\u0027, page 12\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Luteol is by far the most abundant \u0027\u0027carotenol\u0027\u0027 is leaves other leaf xanthophylls include zeaxanthol, violaxanthol, cryptoxanthol, flavoxanthol, and neoxanthin\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carotid", "{\"term\":\"carotid\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027caros\u0027 or Ancient greek (to 1453) \u0027κάρος\u0027 (sleep, stupor) From the fact that the carotid artery supplies blood to the brain, and interruption of this flow causes loss of consciousness.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a number of major arteries in the head and neck\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carousel", "{\"term\":\"carousel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French \u0027carrousel\u0027 from Italian \u0027carosello\u0027 probably from \u0027carro\u0027 from Latin \u0027carrus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a merry-go-roun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a continuously revolving device for item deliveryImage:Afbeelding thumb|A baggage carousel at an airport\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"After collecting his suitcase at the baggage \u0027\u0027carousel\u0027\u0027, he left the airport\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the rotating glass plate in a microwave ove\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A visual component that displays a series of images one at a time\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carpal", "{\"term\":\"carpal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin {{m|la|carpālis}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the eight bones of the wrist (carpus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carpel", "{\"term\":\"carpel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027carpelle\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the individual female reproductive organs in a flower. A carpel is composed of an ovary, a style, and a stigma, although some flowers have carpels without a distinct style. In origin, carpels are leaves (megasporophylls) that have evolved to enclose the ovules. The term pistil is sometimes used to refer to a single carpel or to several carpels fused together\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carpellody", "{\"term\":\"carpellody\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant disorder, resulting in misshapen fruits, caused by abnormal development of the ovule-bearing part of the flower in angiosperms\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carpenter", "{\"term\":\"carpenter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) from Anglo-norman {{m|fro|carpentier}}, from (compare Old french (842-ca. 1400) {{m|fro|charpantier}}), from {{m|la|carpentārius||a carpenter}}, Latin {{m|la|carpentārius||a wagon-maker, carriage-maker}}, from Latin {{m|la|carpentum||a two-wheeled carriage, coach, or chariot, a cart}}, from Gaulish {{m|cel-gau|carbantos}}, from Proto-celtic {{m|cel-pro|*karbantos||chariot, war chariot}}, probably related to Proto-celtic {{m|cel-pro|*karros||wagon}}. More at {{m|en|car}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person skilled at carpentry, the trade of cutting and joining timber in order to construct buildings or other structures\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A senior rating in ships responsible for all the woodwork onboard; in the days of sail, a warrant officer responsible for the hull, masts, spars and boats of a ship, and whose responsibility was to sound the well to see if the ship was making water\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A two-wheeled carriage\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carper", "{\"term\":\"carper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person who habitually car\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"carps, who talks too much and regularly finds faul\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1605\u0026amp;ndash;1608\u0027\u0027: By putting on the cunning of a \u0027\u0027carper\u0027\u0027 \u0026amp;mdash; William Shakespeare, \u0027Timon of Athens\u0027, 1605\u0026amp;ndash;160\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1678\u0027\u0027: Come, let my \u0027\u0027carper\u0027\u0027 to his life now look, / And find there darker lines than in my book \u0026amp;mdash; John Bunyan, \u0027The Pilgrim\u0027s Progress\u0027, 167\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1909\u0026amp;ndash;1914\u0027\u0027:He censures everything, this zealous \u0027\u0027carper\u0027\u0027. \u0026amp;mdash; Curtis Hidden Page\u0027s translation of \u0027Tartuffe or the Hypocrite\u0027 by Jean Baptiste Poquelin Moliere, 1909\u0026amp;ndash;1914\", \"priority\":5}]}, \"synonyms\":{}}");

	add("carpet", "{\"term\":\"carpet\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Italian\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027carpite\u0027 from Italian \u0027carpita\u0027 \u0027carpita\u0027 the past participle of Latin \u0027carpere\u0027 (to pluck)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"uncountable and countable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fabric used as a complete floor covering\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A great bargain also had been the excellent Axminster \u0027\u0027carpet\u0027\u0027 which covered the floor; as, again, the arm-chair in which Bunting now sat forward, staring into the dull, small fire\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe half-dozen pieces […] were painted white and carved with festoons of flowers, birds and cupids. To display them the walls had been tinted a vivid blue which had now faded, but the \u0027\u0027carpet\u0027\u0027, which had evidently been stored and recently relaid, retained its original turquoise\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any surface or cover resembling a carpet or fulfilling its function\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the grassy \u0027\u0027carpet\u0027\u0027 of this plai\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A wrought cover for tables\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1606-1661\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Tables and beds covered with copes instead of \u0027\u0027carpets\u0027\u0027 and coverlets\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s pubic hair\", \"priority\":11}]}, \"synonyms\":{}}");

	add("carpetbagger", "{\"term\":\"carpetbagger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|carpetbag|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An immigrant from the Northern to the Southern States after the American Civil War of 1861–5, especially one who went South to gain political influence; hence, someone intervening in the politics of an area with which they are thought to have no real connection\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Though he lived and worked in Los Angeles for sixteen years, the candidate for Attorney General is no \u0027\u0027carpetbagger\u0027\u0027; he was born and raised in this state and graduated from the state university\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s just a \u0027\u0027carpetbagger\u0027\u0027 who was surprised to find that Southerns are not like the cast of \u0027The Dukes of Hazzard\u0027 or \u0027Deliverance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who comes to a place or organisation with which they have no previous connection with the sole or primary aim of personal gain, especially political or financial gain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 339\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"By the tenth century, out of the diversity of these Christianized Anglo-Saxon kingdoms emerged one of the most coherent political units in Europe, a single monarchy of England, with a precociously centralized government which eventually fell like a ripe plum into the grateful hands of Norman \u0027\u0027carpetbaggers\u0027\u0027 in 1066\", \"priority\":6}]}, \"synonyms\":{}}");

	add("carpetball", "{\"term\":\"carpetball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|carpet|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A game, similar to pool and played with pool balls, played in a long, high-walled table. Each player gets five balls to arrange however they want at their end of the table, and they take turns trying to knock each other\u0027s balls into troughs at each end of the table. The player who knocks down all five of the other player\u0027s balls first is the winner\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carplane", "{\"term\":\"carplane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|car|plane|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vehicle that can drive on land like a car or fly like an aeroplane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, Alfred Elton Van Vogt, \u0027The weapon shops of Isher\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Outside Bedrock headed for a \u0027\u0027carplane\u0027\u0027 stop in a meditative mood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, David M. Newman, Elizabeth Grauerholz, \u0027Sociology of families\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Unlike some other fictional portrayals of future family life — which simply place traditional family structures in a high-tech futuristic setting of \u0027\u0027carplanes\u0027\u0027, fully automated appliances, interplanetary civilizations, and robot servants\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Caroline Nixon, Michael Tomlinson, \u0027Kid\u0027s Box 6 Pupil\u0027s Book, Volume 6\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The sides of the \u0027\u0027carplane\u0027\u0027 will open by moving slowly down under the floor of the car. There won\u0027t be any maps and we\u0027ll never get lost because carplanes will always know where to go\", \"priority\":7}]}, \"synonyms\":{}}");

	add("carpology", "{\"term\":\"carpology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|carpo|logy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the study of the structure of seeds and fruit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carpsucker", "{\"term\":\"carpsucker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|carp|sucker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various fish of the genus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carpule", "{\"term\":\"carpule\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|cartridge|ampule|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of ampule or cartridge containing liquid medication to be inserted using a syringe. It is often a tube with a puncturable cap on one end and a sliding plug on the other end\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carpus", "{\"term\":\"carpus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From from Ancient greek (to 1453) \u0027καρπός\u0027 (wrist)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The group of bones that make up the wrist\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carrageenan", "{\"term\":\"carrageenan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A food additive made from a purified extract of red seaweed, commonly used as a thickening agent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carrel", "{\"term\":\"carrel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A partially partitioned space for studying or reading, often in a library\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He was busy writing his report in a small library \u0027\u0027carrel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A quarrel, or square-headed arrow\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carriage", "{\"term\":\"carriage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027cariage\u0027 from \u0027carier|lang\u003dfro\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of conveying; carrying\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Means of conveyance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A wheeled vehicle, generally drawn by horse power\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027carriage\u0027\u0027 ride was very romantic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A rail car, \u0027esp.\u0027 designed for the conveyance of passengers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A manner of walking and moving in general; how one carries oneself, bearing, gait\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, II.i\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027carriage\u0027\u0027 was full comely and vpright, / His countenaunce demure and temperate\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0027Hitch-22\u0027, Atlantic 2011, p. 90\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He chose to speak largely about Vietnam [...], and his wonderfully sonorous voice was as enthralling to me as his very striking \u0027\u0027carriage\u0027\u0027 and appearance\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s behaviour, or way of conducting oneself towards others\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, p. 407\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"He now assumed a \u0027\u0027carriage\u0027\u0027 to me so very different from what he had lately worn, and so nearly resembling his behaviour the first week of our marriage, that [...] he might, possibly, have rekindled my fondness for him\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Lord Byron, \u0027Don Juan\u0027, I\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Some people whisper but no doubt they lie, / For malice still imputes some private end, / That Inez had, ere Don Alfonso\u0027s marriage, / Forgot with him her very prudent \u0027\u0027carriage\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The part of a typewriter supporting the paper\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A shopping cart\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A stroller; a baby carriage\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The charge made for conveying (especially in the phrases \u0027carriage forward\u0027, when the charge is to be paid by the receiver, and \u0027carriage paid\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"That which is carried, baggag\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"And David left his \u0027\u0027carriage\u0027\u0027 in the hand of the keeper of the \u0027\u0027carriage\u0027\u0027, and ran into the army, and came and saluted his brethren\", \"priority\":21}]}, \"synonyms\":{}}");

	add("carrie", "{\"term\":\"carrie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pet form of Caroline, also used as a formal female given name\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carrier", "{\"term\":\"carrier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|carry}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or object that carries someone or something else\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"aircraft \u0027\u0027carrier\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"armored personnel \u0027\u0027carrier\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The air which is but a \u0027\u0027carrier\u0027\u0027 of the sounds\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A carrier pigeon, a newspaperese term (misnomer) for a homing pigeon, racing pigeon, racing homer, homer\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An Old English carrier pigeon or Old English carrier (the \u0026quot;King of the Doos\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person or company in the business of shipping freight\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The roads are crowded with \u0027\u0027carriers\u0027\u0027, laden with rich manufactures\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A signal such as radio, sound, or light that is modulated to transmit information\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A mobile network operator; wireless carrier\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A certified airline\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 Dec. 22, Jad Mouawad and Martha C. White, \u0026quot;[http://www.nytimes.com/2013/12/23/business/on-jammed-jets-sardines-turn-on-one-another.html?hp],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 23 December 2013)\u0026lt;/small\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Southwest, the nation’s largest domestic \u0027\u0027carrier\u0027\u0027, is installing seats with less cushion and thinner materials — a svelte model known in the business as “slim-line.”\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"That which drives or carries\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A piece which communicates to an object in a lathe the motion of the faceplate; a lathe dog\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A spool holder or bobbin holder in a braiding machine\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A movable piece in magazine guns which transfers the cartridge to a position from which it can be thrust into the barrel\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A catalyst or other intermediary in a chemical reaction\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"An organism that has inherited a genetic trait or mutation, but displays no symptoms\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A person or animal that transmits a disease to others without itself contracting the disease\", \"priority\":22}]}, \"synonyms\":{}}");

	add("carrion", "{\"term\":\"carrion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027caroigne\u0027 from Latin \u0027caro|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dead flesh; carcasses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Vultures feed on \u0027\u0027carrion\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They did eat the dead \u0027\u0027carrions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1922,\u0027\u0027 w:Virginia Virginia Woolf, \u0027w:Jacob\u0027s Jacob\u0027s Room\u0027, Vintage Classics, paperback edition, page 11\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Perhaps the Purple Emperor is feasting, as Morris says, upon a mass of putrid \u0027\u0027carrion\u0027\u0027 at the base of an oak tree\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A contemptible or worthless person\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Old feeble \u0027\u0027carrions\", \"priority\":9}]}, \"synonyms\":{}}");

	add("carrollite", "{\"term\":\"carrollite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Carroll|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An isometric-hexoctahedral mineral containing cobalt, copper, nickel, and sulfur\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carrot", "{\"term\":\"carrot\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027carotte\u0027 from Latin \u0027carōta\u0027 from Ancient greek (to 1453) {{m|grc|κᾰρωτόν}}. Displaced native {{m|en|more}}, from Old english (ca. 450-1100) {{m|ang|moru}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vegetable with a nutritious, juicy, orange, sweet root, \u0027Daucus carota\u0027 in the family Apiaceae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A shade of orange similar to the flesh of carrots\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A motivational tool\", \"priority\":3}]}, \"synonyms\":{}}");

	add("carryback", "{\"term\":\"carryback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|carry|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A income tax loss or credit that can be applied to offset previously taxed income or taxes paid, respectively\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carryforward", "{\"term\":\"carryforward\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|carry|forward|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An income tax loss or credit not usable in the current year that can be applied to offset income or taxes paid, respectively, in subsequent tax years\", \"priority\":1}]}, \"synonyms\":{}}");

