	add("carte", "{\"term\":\"carte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French See \u0027card\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bill of fare; a menu\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A visiting card\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, Emma Jane Worboise, \u0027The fortunes of Cyril Denham\u0027 (page 258\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;He only says she is Laura Somerset, and he sends me her \u0027\u0027\u0027carte\u0027\u0027\u0027; here it is.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("cartel", "{\"term\":\"cartel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French \u0027cartel\u0027 from Italian \u0027cartello\u0027 diminutive of \u0027carta\u0027 (card, page) from Latin \u0027charta\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of businesses or nations that collude to limit competition within an industry or market\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A combination of political groups (notably parties) for common action\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A written letter of defiance or challenge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He is cowed at the very idea of a \u0027\u0027cartel\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Folio Society, 2006, p.22\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Xerxes\u0027 whipped the Sea, and writ a \u0027\u0027cartell\u0027\u0027 of defiance to the hill \u0027Athos\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An official agreement concerning the exchange of prisoners\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027, \u0027Tales from the Alhambra\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"He then sent down a flag of truce in military style, proposing a \u0027\u0027cartel\u0027\u0027 or exchange of prisoners – the corporal for the notary\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A ship used to negotiate with an enemy in time of war, and to exchange prisoners\", \"priority\":11}]}, \"synonyms\":{}}");

	add("carter", "{\"term\":\"carter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027careter\u0027 (compare French charretier).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who transports a load on a cart that is drawn by a beast of burden\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carternomics", "{\"term\":\"carternomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|Carter|economics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Economic policies associated with the administration of w:Jimmy Jimmy Carter, 1977-1981\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cartesianism", "{\"term\":\"cartesianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Cartesian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The philosophical doctrines of\", \"priority\":1}]}, \"synonyms\":{}}");

	add("carthage", "{\"term\":\"carthage\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"official aramaic (700-300 bce)\", \"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\", \"phoenician\"], \"text\":\"From Latin {{m|la|Carthāgo}}, from Phoenician \u0027𐤒𐤀𐤓𐤕𐤇𐤀𐤃𐤀𐤔𐤕\u0027 (tr\u003dqart-ḥadašt) implying that it was a “new Tyre” (Carthage was founded by Phoenician colonists from Tyre). Compare the Official aramaic (700-300 bce) \u0027קרתא חדאתא\u0027 (tr\u003dqarta ḥdatha) Cognate to Ancient greek (to 1453) \u0027καρχηδών\u0027 () Arabic \u0027قَرْطَاج\u0027 () modern Hebrew \u0027קרתגו\u0027 (tr\u003dqartágo)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ancient city in North Africa, in modern Tunisi\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several cities in Illinois, Mississippi, Missouri, South Dakota, Texa\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several towns in Arkansas, Indiana, Maine, North Carolina, Tennessee\", \"priority\":3}]}, \"synonyms\":{}}");

	add("cartilage", "{\"term\":\"cartilage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027cartilage\u0027 from Latin {{m|la|cartilāgō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of dense, non-vascular connective tissue, usually found at the end of joints, the rib cage, the ear, the nose, in the throat and between intervertebral disks\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cartload", "{\"term\":\"cartload\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|cart|load|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The amount that a cart can carry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027 Francis Rawdon Chesney - The Russo-Turkish Campaigns of 1828 and 182\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Two days of skirmishing outside the town were followed by a bold sortie headed by a dervish; and, as the result of this affair, a \u0027\u0027cartload\u0027\u0027 of heads was sent as trophies to Constantinople\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any large amount\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027 Edward Everett - The Mount Vernon Paper\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"although a little apt to get buried under a \u0027\u0027cartload\u0027\u0027 of written pleadings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A load: various English units of weight or volume based upon standardized cartloads of certain commodities\", \"priority\":7}]}, \"synonyms\":{}}");

	add("cartographer", "{\"term\":\"cartographer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cartography|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes maps or charts\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cartography", "{\"term\":\"cartography\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027cartographie\u0027 from \u0027carte\u0027 () (ultimately from Ancient greek (to 1453) \u0027χάρτης|lang\u003dgrc\u0027 () + \u0027-graphie\u0027 () (, from \u0027γράφω\u0027 (write) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The creation of charts and maps based on the layout of a territory\u0027s geography\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An illustrative discussion of a topic\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cartology", "{\"term\":\"cartology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The creation of charts and maps based on the layout of a territory\u0027s geography\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cartomancy", "{\"term\":\"cartomancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Confer French \u0027cartomancie\u0027 See \u0027card\u0027 and \u0027-mancy\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fortune telling using cards, as in tarot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cartooney", "{\"term\":\"cartooney\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Possibly a portmanteau of the words \u0027cartoon\u0027 (alluding to fantasy and exaggeration) and \u0027attorney\u0027, or a variation of \u0027cartoony (cartoon-like).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An empty and comically overstated threat of legal action, or a mock legal action\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cartoonist", "{\"term\":\"cartoonist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cartoon|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Person who creates a cartoon or strip cartoons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Person who both writes \u0027\u0027and\u0027\u0027 illustrates comic books or graphic novels\", \"priority\":2}]}, \"synonyms\":{}}");

