	add("cartouche", "{\"term\":\"cartouche\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Italian\", \"Latin\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027cartouche\u0027 from Italian \u0027cartuccia\u0027 from \u0027carta\u0027 from Latin \u0027charta\u0027 from Ancient greek (to 1453) \u0027χάρτης\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ornamental figure, often on an oval shield\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an oval figure containing characters that represent the names of royal or divine people\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027 — w:Henry Rider H. Rider Haggard, She\u0027, ch II\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Besides the uncial writing on the convex side of the sherd at the top, painted in dull red, on what had once been the lip of the amphora, was the \u0027\u0027cartouche\u0027\u0027 already mentioned as being on the scarabaeus, which we had also found in the casket. The hieroglyphics or symbols, however, were reversed, just as though they had been pressed on wax\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A paper cartridge\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A wooden case filled with balls, to be shot from a cannon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A gunner\u0027s bag for ammunition\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A military pass for a soldier on furlough\", \"priority\":8}]}, \"synonyms\":{}}");

	add("cartridge", "{\"term\":\"cartridge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Corruption of French \u0027cartouche\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The package consisting of the bullet, primer, and casing containing gunpowder; a round of ammunition (w:Cartridge Wikipedia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A prefabricated subassembly that can be easily installed in or removed from a larger mechanism or replaced with another interchangeable subassembly\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A vessel which contains the ink (w:Ink Wikipedia) or toner (w:Toner Wikipedia) for a computer printer and can be easily replaced with another\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Magnetic tape storage, used for storing (backup) copies of data (w:Magnetic tape data Wikipedia\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Helpline\u0027 (in \u0027Sinclair User\u0027 issue 21\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The program generates a catalogue of the files on the \u0027\u0027cartridge\u0027\u0027 selected by the user, reads the catalogue into memory and erases the cartridge copy, so that an up-to-date copy is always generated\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A removable enclosure containing read-only memory devices, used for rapid loading of software onto a home computer or video game console\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, \u0027Communication Outlook\u0027 (volume 3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"We would like to see someone market a low-power, text-to-speech \u0027\u0027cartridge\u0027\u0027 that would mate with the Epson and use its internal battery pack\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027Video Game Bible, 1985-2002\u0027 (page 180\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Nintendo made sure to loudly trumpet all of the advantages of the \u0027\u0027cartridge\u0027\u0027 format, particularly the greatly reduced loading times and the sturdiness of the cartridge\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A small paper package, e.g. in an old book about making printer\u0027s type: \u0027After all the type has been cast: \u0026quot;The Boy will paper up each sort in a \u0027\u0027cartridge\u0027\u0027 by itself\u0026quot\", \"priority\":12}]}, \"synonyms\":{}}");

